# This file contains common pin mappings for the BigTreeTech SKR 2.
# To use this config, the firmware should be compiled for the
# STM32F407 with a "32KiB bootloader".

# In newer versions of this board shipped in late 2021 the STM32F429
# is used, if this is the case compile for this with a "32KiB bootloader"
# You will need to check the chip on your board to identify which you have.
#
# The "make flash" command does not work on the SKR 2. Instead,
# after running "make", copy the generated "out/klipper.bin" file to a
# file named "firmware.bin" on an SD card and then restart the SKR 2
# with that SD card.

# See docs/Config_Reference.md for a description of parameters.

# Note: The initial revision of this board has a flaw that can cause
# damage to itself and other boards. Be sure to verify the board is
# not impacted by this flaw before using it.


[include mainsail.cfg]
[include enclosure_leds.cfg]
[include mcu_ebb36Gen2.cfg]
[include filament_sensors.cfg]
[include klipper_macros_custom_with_soak_v8f.cfg]
[include mcu_eddy.cfg]

[include bed_config.cfg]
[include stealthburner_leds.cfg]
#[include klipper_macros.cfg]
#[include mcu_ebb36.cfg]
#[include orbitersensor_config.cfg]
#[include orbiter2_smartsensor3.1.cfg]
[include mmu_macros.cfg]
#[include mmu/base/*.cfg]
#[include mmu/optional/client_macros.cfg]

######################################
# Printer Settings
######################################

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f407xx_350033001550305031353020-if00

[printer]
kinematics: corexy
max_velocity: 350  
max_accel: 3000
max_z_velocity: 50
max_z_accel: 350
square_corner_velocity: 10.0

#[temperature_sensor MCU]
#sensor_type: temperature_mcu

[temperature_sensor SoC]
sensor_type: temperature_host

#[fan_generic mcufan]
[temperature_fan controller_fan2]
pin: PB7
sensor_type: temperature_mcu
sensor_mcu: mcu
control: watermark
max_power: 0.5
min_temp: 10
max_temp: 65
target_temp: 40
shutdown_speed: 0

[temperature_sensor chamber]
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PA3
min_temp: 0
max_temp: 80


######################################
# Top Steppers
######################################

[stepper_x]
step_pin: PE2
dir_pin: PE1
enable_pin: !PE3
microsteps: 16
rotation_distance: 40
endstop_pin: EBB: PA15
position_endstop: 350
position_max: 350
homing_speed: 25
homing_retract_dist: 5
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PE0
run_current: 0.800
stealthchop_threshold: 0
#diag_pin:

[stepper_y]
step_pin: PD5
dir_pin: !PD4
enable_pin: !PD6
microsteps: 16
rotation_distance: 40
endstop_pin: ^PC3
position_endstop: 350
position_max: 350
homing_speed: 25

[tmc2209 stepper_y]
uart_pin: PD3
run_current: 0.800
stealthchop_threshold: 0
#diag_pin:

######################################
# Z Bed Steppers
######################################


[stepper_z]
step_pin: PA15
dir_pin: !PA8
enable_pin: !PD1
microsteps: 32
rotation_distance: 4
endstop_pin: ^PC0
position_endstop: 0.2
position_max: 250
position_min: -2.5
homing_speed : 8.0
second_homing_speed: 3
homing_retract_dist: 3

[tmc2209 stepper_z]
uart_pin: PD0
interpolate: False
run_current: 0.6
sense_resistor: 0.110
stealthchop_threshold: 0

[stepper_z1]
step_pin: PD15
dir_pin: !PD14
enable_pin: !PC7
microsteps: 32
rotation_distance: 4

[tmc2209 stepper_z1]
uart_pin: PC6
interpolate: False
run_current: 0.6
sense_resistor: 0.110
stealthchop_threshold: 0

[stepper_z2]
step_pin: PD11
dir_pin: !PD10
enable_pin: !PD13
microsteps: 32
rotation_distance: 4

[tmc2209 stepper_z2]
uart_pin: PD12
interpolate: False
run_current: 0.6
sense_resistor: 0.110
stealthchop_threshold: 0

######################################
# Heated Bed
######################################

[heater_bed]
heater_pin: PD7
sensor_type: Generic 3950
sensor_pin: PA1
#control: watermark
min_temp: 0
max_temp: 130

######################################
# RGB
######################################

[neopixel enclosure]
pin: PE6
chain_count: 50
color_order: GRB
initial_RED: 0.7
initial_GREEN: 0.7
initial_BLUE: 0.7

[fan_generic exhaust_fan]
pin: PB6
kick_start_time: 0.5
off_below: 0.1


#[heater_fan fan1]
#pin: PB6

#[heater_fan fan2]
#pin: PB5

# Due to BTT implementing a Marlin-specific safety feature,
# "anti-reversal stepper protection", this pin needs pulling
# high to pass power to stepper drivers and most FETs

[output_pin motor_power]
pin: PC13
value: 1

########################################
# EXP1 / EXP2 (display) pins
########################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PC5, EXP1_3=PB1, EXP1_5=PE10, EXP1_7=PE12, EXP1_9=<GND>,
    EXP1_2=PB0, EXP1_4=PE9, EXP1_6=PE11, EXP1_8=PE13, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PA6, EXP2_3=PE7, EXP2_5=PB2, EXP2_7=PC4,   EXP2_9=<GND>,
    EXP2_2=PA5, EXP2_4=PA4, EXP2_6=PA7, EXP2_8=<RST>, EXP2_10=<NC>

#####################################################################
#   Exclude Object
#####################################################################

[exclude_object]

